import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

import "../node_modules/font-awesome/css/font-awesome.min.css"




ReactDOM.render(
  <BrowserRouter>
  
  <React.StrictMode>
    <App/>
  </React.StrictMode>
  </BrowserRouter>,
  document.getElementById("root")
);

